const mapStateToProps = state => {
  return {
    user: state.user,
    medInfo: state.meds.meds,


  }
}
  const mapDispatchToProps = dispatch => {

    return {
      fetchMeds: (meds)=>{
        dispatch(fetchMeds(meds));
      },
      deleteMeds: (id) =>{
        dispatch(deleteMeds(id))
      }

    }

  }

